import Layout from "../components/Layout";
import {Button} from 'react-bootstrap'

function HomePage() {
 return (
  <Layout title={"Anasayfa"} headText={"Anasayfa"}>
   <h1>ANASAYFA</h1>
   <Button variant="warning">Warning</Button>
  </Layout>
 );
}

export default HomePage;
